def remove_non_english(df):
  def is_english(text):
    words = word_tokenize(text)
    english_word_count = sum(len(word) >= 2 for word in words)
    return english_word_count / len(words) >= 0.7

  df_filtered = df[df['title'].apply(is_english)]
  return df_filtered

